import React, { Component } from 'react';
import axios from 'axios'
import Quote from '../../Components/Quote/quote.js'
import Buy from '../../Components/Buy/buy.js'
import Portfolio from '../../Components/Portfolio/portfolio'
import Funds from '../../Components/Funds/funds.js'



class Homepage extends Component {

    // fetching the GET route from the Express server which matches the GET route from server.js
    callBackendAPI = async () => {
      axios.get('index').then(res => {
          console.log("Hiiiii");
          if (res.status !== 200) {
              throw Error(res.message) 
          }
          return res;
      });
    };


    render() {
      return (
        <div className="homepage">


          <Quote/>

          <Funds />

          <Portfolio /> 

          <button>CANCEL_BUY</button>
          <button>CANCEL_SELL</button>
          <button>COMMIT_SELL</button>
          <button>CANCEL_SET_BUY</button>
          <button>CANCEL_SET_SELL</button>
          <button>DISPLAY_SUMMARY</button>




          <Buy/>

          COMMIT_BUY

          SET_BUY_AMOUNT

          SET_BUY_TRIGGER


        </div>
      );
    }

  }

  export default Homepage;
